import './App.css';

import Shader1 from './components/Shader1.js'
import Video from './components/Video.js'
import Handtrack from './components/Handtrack.js'

function App() {
  return (
    <div className="App">
      <div id="webgl-canvas">
      <Video/> 
      <Handtrack/>
      <canvas id="myCanvas" width="100%" height="100%"></canvas>
      </div>
    </div>
  );
}

export default App;
